import React from 'react';
import { FormControlLabel, Grid, Slider, Switch, Typography } from '@material-ui/core';

function DataControls() {
    return(
        <>
            <Typography variant="body1" style={{margin:"10px"}}>Data Controls</Typography>

            <div className="DataSizeControl" style={{margin:"20px"}}>
                <Typography variant="body1">Data Size</Typography>
                <Grid container spacing={2}>
                    <Grid item>
                        <Typography variant="body1">10</Typography>
                    </Grid>
                    <Grid item xs>
                        <Slider value={50}/>
                    </Grid>
                    <Grid item>
                        <Typography variant="body1">1000</Typography>
                    </Grid>
                </Grid>
            </div>

            <div className="UniqueValsControl" style={{margin: "20px"}}>
                <FormControlLabel
                    control={
                    <Switch
                        checked={true}
                        color="primary"
                    />
                    }
                    label="Unique Values"
                />
            </div>
        </>
    );
}

export default DataControls;
